import React from 'react';

export default function index() {
    return (
        <div>
            <div className="absolute top-0 h-20 w-full bg-white rounded-b-full p-3 px-6">
                <div>
                    <img className="w-12 h-12 " src="/images/logo.png" />
                </div>
            </div>
        </div>
    );
}
